import React from "react";
import Data from '../../shop-data.json';

const Shop = () => {
    return (
        <div>
        {
            Data.map(({id, name }) => (
            <div>
                <h2 key={id}>{name}</h2>
            </div>
            ))
        }
        </div>
    )
  }
export default Shop;
